import React from "react";

export default function Header() {
  return (
    <>
      <header className="main-header">
        <div></div>
        <h1>Pirate Crew</h1>
        <button className="btn" onClick={(e) => navigate("/pirate/new")}>
          Add Pirate
        </button>
      </header>
    </>
  );
}
